import { SET_BRAND_DATA } from '../../constants/actionTypes';

const INITIAL_STATE = {
  brandList: [],
  searchName: '',
  currentPage: 1,
  totalRecords: 0
};

export default (state = INITIAL_STATE, action = {}) => {
  switch (action.type) {
    case SET_BRAND_DATA:
      return {
        ...state,
        ...action.content,
      };
    default:
      return state;
  }
};
